import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let posts = [
    {id: 1, message: 'Hi, how are you?', likesCount: 12},
    {id: 2, message: 'It is my post.', likesCount: 38},
    {id: 3, message: 'Yo', likesCount: 0},
    {id: 4, message: 'Uroy', likesCount: 13}
];

let dialogsData = [
    {id: 1, name: 'Sasha'},
    {id: 2, name: 'Kolechka'},
    {id: 3, name: 'Andrey'},
    {id: 4, name: 'Chekatilo'},
    {id: 5, name: 'Vorobey'}
];

let messagesData = [
    {id: 1, message: 'Hi!'},
    {id: 2, message: 'Byhai'},
    {id: 3, message: 'How is your wife?'},
];

ReactDOM.render(<App posts={posts} dialogsData={dialogsData} messagesData={messagesData}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
